import React from 'react'

export default function Checkout() {
    return (
        <div>
            <Container>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>Order History</th>
                            <th>Card Number</th>
                            <th>Total</th>
                        </tr>
                    </thead>
                    <tbody>
                        {order1.map((value, index) => {
                            return (
                                <tr>
                                    <td>{value.name}</td>
                                    <td>{value.cardnumber}</td>
                                    <td>{value.total}</td>
                                </tr>
                            );
                        })}
                    </tbody>
                </Table>
            </Container>
        </div>
    )
}
